content:
Optionally, you can override the metadata that is generated by a transformation. You can override object and field attributes.

Available in: Salesforce Classic and Lightning Experience
Available for an additional cost in: Enterprise, Performance, and Unlimited Editions

You can override the following object attributes:

* label (String): The display name for the object.
* description (String): The description of the object.

You can also override the following field attributes:

* name (String): Name of the field in the dataset.
* label (String): The display name for the field.
* description (String): The description of the field.
* isSystemField (Boolean): Indicates whether this field is a system field to be excluded from query results.
* format (String): The display format of the numeric value.

For example, you can override the attributes in the sfdcDigest transformation by adding the Schema section with the override values to sfdcDigest in the dataflow definition file.

{
  "Extract_Opportunities": {
    ...
    "schema": {
      "objects": [
        {
          "label":"Sales Opportunities",
          "description": "These are all sales opportunities.",
          "fields": [
            {
              "name": "Id",
              "label": "Opportunity Id",
              "isSystemField": true
            },
            {
              "name": "Amount",
              "label": "Opportunity Amount",
              "format": "$#,##0.00"
            }
          ]
        }
      ]
    }
  }
}
